@namespace url(http://www.w3.org/1999/xhtml);



@-moz-document domain("jappy.de"), domain("jappy.at"), domain("jappy.tv") {





.logo {opacity:1.6;

	height: 0 !important;

	width: 0 !important;

	padding-left: 164px !important;

	padding-top:64px !important;

	background: url(http://www.abload.de/img/jappyaubergineczw5.gif) center no-repeat !important;}



body { padding-left:0px !important;

	padding-top:0px !important;

        background:url(http://a.imageshack.us/img829/7850/lilal.jpg)fixed  !important;}



#rs, #no, .enter, TD,#mx{background:url(http://a.imageshack.us/img829/7850/lilal.jpg)fixed  !important;}



.a{color:#FFFFFF!important;}

.passive,.inactive{background: url(http://a.imageshack.us/img834/3870/taskoben.gif) !important;}



A.passive ,A.inactive,P,A.online,A.fs16,A.ldU,A.gb,A.sites ,A.flirt,A.inCo,A.inDp,.enable ,.fwB,A.inDpW,A.inG2,A.inG1{color:#ffffff !important;}



A.galerie ,A.gb ,A.sites ,A.flirt {background: url(http://a.imageshack.us/img686/6759/butten.gif) !important;color:#ffffff}



.liG5 ,.inCo, .inDp,.inDpW,.inG2,.inAc,.inG1,.enable{background: url(http://a.imageshack.us/img294/7949/tabellenkopf.gif) !important;color:#F4F4F4}



.blCount, .online, A.set {background: url(http://a.imageshack.us/img839/6509/listenlinks.gif) !important; color:#F4F4F4}





#br .line {opacity:1.6;

	background: url(http://a.imageshack.us/img834/3870/taskoben.gif) !important;

	background-color: #000;

	color:#FFFFFF}



    div .spAdMR {display: none !important ; } 

    div .promiflash {display: none !important ; }

    div #ad2, #google_ads_div_MediumRectangle, #noBanner, #ad3B  {display: none !important ; }



    div .page {position:relative; left:80px; }

.pad {background: url(http://a.imageshack.us/img137/5907/buttenj.gif) !important;}

.nav {position:relative; left:-160px; }

}

